import React, { useState, useEffect } from "react";
import Select from "react-select";
import config from "./config";
import "./App.css";

const { BACKEND_URL } = config;

function App() {
  const [zipCode, setZipCode] = useState("");
  const [resolvedCountry, setResolvedCountry] = useState("");
  const [resolvedTown, setResolvedTown] = useState("");
  const [countries, setCountries] = useState([]);
  const [towns, setTowns] = useState([]);
  const [result, setResult] = useState(null);
  const [error, setError] = useState(null);

  // Fetch countries and towns when the component loads
  useEffect(() => {
    const fetchLocations = async () => {
      try {
        const countryResponse = await fetch(`${BACKEND_URL}/countries`);
        const countryData = await countryResponse.json();
        setCountries(
          countryData.countries.map((country) => ({
            value: country,
            label: country.charAt(0).toUpperCase() + country.slice(1),
          }))
        );

        const townResponse = await fetch(`${BACKEND_URL}/towns`);
        const townData = await townResponse.json();
        setTowns(
          townData.towns.map((town) => ({
            value: town,
            label: town.charAt(0).toUpperCase() + town.slice(1),
          }))
        );
      } catch (err) {
        setError("Failed to fetch locations. Please try again.");
      }
    };

    fetchLocations();
  }, []);

const handlePredict = async () => {
  setResult(null);
  setError(null);

  let location = resolvedTown || resolvedCountry;

  if (!zipCode && !resolvedCountry && !resolvedTown) {
    setError("Please provide a ZIP code, country, or town.");
    return;
  }


  // If ZIP code is provided, resolve it to a country or town
  if (zipCode) {
    try {
      const response = await fetch(`${BACKEND_URL}/resolve_zip?zip=${zipCode}`);
      const data = await response.json();

      if (response.ok) {
        setResolvedCountry(data.country || "");
        setResolvedTown(data.town || "");
        location = data.town || data.country;
      } else {
        setError(data.error || "Failed to resolve ZIP code.");
        return;
      }
    } catch (err) {
      setError("Unable to connect to the server for ZIP code resolution.");
      return;
    }
  }

  if (!location) {
    setError("Could not determine location from ZIP code, country, or town.");
    return;
  }

  try {
    const response = await fetch(
      `${BACKEND_URL}/predict?country=${encodeURIComponent(location)}`
    );
    const data = await response.json();

    if (response.ok) {
      const { average, max, min } = data.summary;
      setResult(
        `Prediction:\nMaximum Temperature: ${max}\nAverage Temperature: ${average}\nMinimum Temperature: ${min}`
      );
      setZipCode("");
    } else {
      setError(data.error || "Prediction failed.");
    }
  } catch (err) {
    setError("Unable to connect to the server.");
  }
};



  return (
    <div className="container">
      <button 
  onClick={() => window.open("https://www.linkedin.com/school/pmaccelerator/", "_blank")}
  className="linkedin-button"
      >
  Visit PM Accelerator
      </button>

      <h1>Weather Prediction</h1>
      <div className="form-group">
        <input
          type="text"
          id="zip-code-input"
          value={zipCode}
          onChange={(e) => setZipCode(e.target.value)}
          placeholder="Enter ZIP code here"
        />

        <label htmlFor="country-select">Select a Country:</label>
        <Select
          id="country-select"
          options={countries}
          value={countries.find((option) => option.value === resolvedCountry)}
          onChange={(selectedOption) => {
            setResolvedCountry(selectedOption?.value || "");
            setResolvedTown("");
          }}
          placeholder="Select a country..."
          isClearable
        />

        <label htmlFor="town-select">Select or Type a Town/City:</label>
        <Select
          id="town-select"
          options={towns}
          value={towns.find((option) => option.value === resolvedTown)}
          onChange={(selectedOption) => {
            setResolvedTown(selectedOption?.value || "");
          }}
          onInputChange={(inputValue) => setResolvedTown(inputValue)}
          placeholder="Select or type a town/city..."
          isClearable
        />

        <button onClick={handlePredict}>Get Prediction</button>
      </div>

{result && ( 
  <div className="result">
    <h3>Result for {resolvedTown ? resolvedTown : resolvedCountry ? resolvedCountry : "Unknown Location"}</h3>
    <pre>{result}</pre>
  </div>
)}


      {error && <div className="error">{error}</div>}
    </div>
  );
}

export default App;
